import React from "react";
import useMediaQuery from "@material-ui/core/useMediaQuery";
import Nav from "./components/Nav.jsx";
import Home from "./components/Home.jsx";
import Portfolio from "./components/Portfolio.jsx";
import Contact from "./components/Contact.jsx";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";


function App() {
	const mobileLg = useMediaQuery("(min-width: 400px");
	const tabletSm = useMediaQuery("(min-width: 500px)");
	const tabletLg = useMediaQuery("(min-width: 800px)");
	const desktopSm = useMediaQuery("(min-width: 1100px)");
	const desktopLg = useMediaQuery("(min-width: 1600px)");

	return (
		<Router>
    	<Nav 
    	mobileLg={mobileLg}
    	tabletSm={tabletSm}
    	tabletLg={tabletLg}
    	desktopSm={desktopSm}
    	desktopLg={desktopLg} />
    	<Switch>
	    	<Route path="/" exact component={Home} />
	    	<Route path="/portfolio" component={Portfolio} />
	    	<Route path="/contact" component={Contact} />
    	</Switch>
    </Router>
	)
}

export default App
